Mongo pipeline projection on sub array<p>I have the following document:</p>
<pre><code>{
    id: &quot;myId&quot;,
    boundedPlan: {
        plannedWeeks: [
            0 : {
                weekStartDate: date
                weekEndDate: date
                plannedDays: []
            },
            ...
        ]
    },
    unboundedPlan: {
        plannedWeeks: [
            0 : {
                weekStartDate: date
                weekEndDate: date
                plannedDays: []
            },
            ...
        ]
    }
}
</code></pre>
<p>This plan represent some number of weeks in the future. The plan has a bounded or unbounded plan .<br />
(I have the same structure on two different fields, because in the code they correspond to two different classes with different behavior).</p>
<p>I now have to do the following query.</p>
<p>&quot;Get the current plan week given a date&quot;</p>
<p>I wrote the following pipeline:</p>
<pre><code>[
    { &quot;$match&quot; : { &quot;ownerId&quot; : &quot;defaultOwnerId&quot;}},
    { &quot;$project&quot; : { 
        &quot;boundedPlan&quot; : 1, 
        &quot;unboundedPlan&quot; : 1, 
        &quot;plannedWeeks&quot; : { 
            &quot;$cond&quot; : { 
                &quot;if&quot; : { &quot;$ne&quot; : [&quot;$boundedPlan&quot;, null]}, &quot;then&quot; : &quot;$boundedPlan.plannedWeeks&quot;, 
                &quot;else&quot; : &quot;$unboundedPlan.plannedWeeks&quot;}
            }
        }
    }, 
    { &quot;$match&quot; : { 
        &quot;boundedPlan.plannedWeeks&quot; : { 
            &quot;$elemMatch&quot; : { &quot;weekStart&quot; : { &quot;$lte&quot; : { &quot;$date&quot; : &quot;2021-03-10T00:00:00Z&quot;}}, &quot;weekEnd&quot; : { &quot;$gte&quot; : { &quot;$date&quot; : &quot;2021-03-10T00:00:00Z&quot;}}}}, 
        &quot;$or&quot; : [{ 
            &quot;unboundedPlan.plannedWeeks&quot; : { 
                &quot;$elemMatch&quot; : { &quot;weekStart&quot; : { &quot;$lte&quot; : { &quot;$date&quot; : &quot;2021-03-10T00:00:00Z&quot;}}, &quot;weekEnd&quot; : { &quot;$gte&quot; : { &quot;$date&quot; : &quot;2021-03-10T00:00:00Z&quot;}}}}
        }]}
    }
]

</code></pre>
<p>The problem is the following:</p>
<ul>
<li>knowing that Im operating over a plan with an unbounded plan and explicitly setting the second match :</li>
</ul>
<pre><code>&quot;$match&quot; : { 
    &quot;unboundedPlan.plannedWeeks&quot; : { 
        &quot;$elemMatch&quot; : { &quot;weekStart&quot; : { &quot;$lte&quot; : { &quot;$date&quot; : &quot;2021-03-10T00:00:00Z&quot;}}, &quot;weekEnd&quot; : { &quot;$gte&quot; : { &quot;$date&quot; : &quot;2021-03-10T00:00:00Z&quot;}}}}, 
}
</code></pre>
<p>works.</p>
<ul>
<li>of course I dont know if the plan is from the unbounded or bounded field, so I tried to add the or operator, which causes no selection at all.</li>
</ul>
<p>Is there something Im missing?
(working with spring data mongo)</p>
<p>Thank you</p>

