MongoDb - meaning of pipeline aggregation 100mb limit?<p>New to Mongodb I am trying understand the 100mb limit MongoDb for aggregate pipelines.  Trying to find out what this actually means? Does it apply to the size of the database collection we are performing the aggregate on?</p>
<p>Bit of background we have the following query on an inventory ledger where we are taking a data set, running a group sum to find out which products are still in-stock (ie amount sum is greater than 0). Based on the result where the product is in stock we return those records by running a lookup in the original collection. The query is provided below.</p>
<p>Assume the inventory objects contains about 10 sub fields/record pair. And assume for 1000records/1mb.</p>
<p><strong>QUESTION</strong>
My question is if the inventory collection size reaches 100mb as a JSON object array does this mean the call with fail? ie the max we can run the aggregate on is 100mb x 1000 records = 100,000 records?</p>
<p>BTW we are on a server that does not support writing to disk hence the question.</p>
<pre><code>db.inventory.aggregate([
  {
    $group: {
      _id: {
        &quot;group_id&quot;: &quot;$product&quot;
      },
      &quot;quantity&quot;: {
        $sum: &quot;$quantity&quot;
      }
    }
  },
  {
    &quot;$match&quot;: {
      &quot;quantity&quot;: {
        $gt: 0
      }
    }
  },
  {
    $lookup: {
      from: &quot;inventory&quot;,
      localField: &quot;_id.group_id&quot;,
      foreignField: &quot;$product&quot;,
      as: &quot;records&quot;
    }
  }
])
</code></pre>

