POST request for paginating, sorting results<p>I am currently doing a <code>GET</code> request that uses a bunch of methods that I wrote to query the database and display them. This works great, but I want to make it a <code>POST</code> request method so that the methods do not have to depend on <code>req.query</code>, deal with a json body instead of a string of URL params which would would facilitate the url string not to have anything else except the endpoints and make it as dynamic as possible. Any idea how to do this?</p>
<p>This is my controller method:</p>
<pre><code>exports.getBooks = async (req, res, next) =&gt; {

    const bookList = new BookList(Book.find(), req.query)
        .filter()
        .sort()
        .paginate();

    const books = await bookList.query;

    res.status(200)
        .json({
            books,
        });
};
</code></pre>
<p>This is the BookList class that has all the methods:</p>
<pre><code>class BookList {
    constructor(query, queryString) {
        this.query = query;
        this.queryString = queryString;
    }

    filter() {
        const queryObj = { ...this.queryString };
        const excludedFields = ['page', 'sort', 'limit', 'fields'];
        excludedFields.forEach(el =&gt; delete queryObj[el]);

        let queryStr = JSON.stringify(queryObj);

        this.query = this.query.find(JSON.parse(queryStr));

        return this;
    }

    sort() {
        if (this.queryString.sort) {
            const sortBy = this.queryString.sort.split(',').join(' ');
            this.query = this.query.sort(sortBy);
        } else {
            this.query = this.query.sort('-createdAt');
        }

        return this;
    }

    paginate() {
        const page = Number(this.queryString.page) || 1;
        const limit = Number(this.queryString.limit) || 100;
        const skip = (page - 1) * limit;

        this.query = this.query.skip(skip).limit(limit);

        return this;
    }
}
module.exports = BookList;
</code></pre>

