Why maintain two-way pointers in data design?<p>Assume I have the following schema:</p>
<p><strong>BOOKS COLLECTION:</strong></p>
<pre><code>{
    author: { ...authorObject }
}
</code></pre>
<p><strong>AUTHORS COLLECTION:</strong></p>
<pre><code>{
    books: [{ ...bookObject}]
}
</code></pre>
<p>If I'm already storing the author's information on each book document, why should I store an array of books on each author document? Wouldn't it suffice to query from the books collection whenever I want to see all the books a particular author has written?</p>
<p>I found a similar schema here: <a href="https://www.howtographql.com/graphql-js/6-authentication/" rel="nofollow noreferrer">https://www.howtographql.com/graphql-js/6-authentication/</a></p>
<p>Every link has a &quot;postedBy&quot; field, and each user has a &quot;links&quot; field. Why store the same information in both places? Isn't it inefficient? For instance, if one removes a link (or a book in the example above), you'd have to update the corresponding user's (or author's) document.</p>
<p>Just trying to understand why we need to store the <strong>same</strong> information in <strong>both</strong> directions. Feels a bit redundant.</p>

