<pre class="lang-js prettyprint-override"><code>var INPUT_ARRAY = [ &quot;1000000000&quot;, &quot;1000000050&quot;, &quot;1000000100&quot;, &quot;1000000101&quot; ];
</code></pre>
<p>this array will contains 2k-3k values. I also have a collection <code>employees</code> with employee details around 100000 documents like given below:</p>
<pre class="lang-js prettyprint-override"><code>{
  &quot;_id&quot;: {
    &quot;$oid&quot;: &quot;60536cc1aafebb0d10399df8&quot;
  },
  &quot;phone&quot;: &quot;1000000000&quot;,
  &quot;first_name&quot;: &quot;john&quot;,
  &quot;last_name&quot;: &quot;doe&quot;
}
</code></pre>
<p>I need to match dynamic array values against employee collections and need to return all the phone numbers from dynamic array that don't exists in employees collection.</p>
<p>I searched a lot for this and also checked following questions
<a href="https://stackoverflow.com/questions/44973140/compare-arrays-and-return-the-difference">Compare arrays and Return the Difference</a>
