Mongo Node Driver Inserts Integer Values Instead of Doubles<p>I'm using the Mongo Native Javascript driver to insert data into a Mongo database. All of the docs I've read say that Mongo stores all of its numeric values as Doubles, and Javascript also stores all of its numerics as doubles. I can confirm that this works in the shell:</p>
<pre><code>PRIMARY&gt; db.products.insertOne({id: 10, price: 10})
PRIMARY&gt; db.products.insertOne({id: 11, price: 11.99})

PRIMARY&gt; db.products.aggregate([{$project: { price: {$type: &quot;$price&quot;}}}])
{ &quot;_id&quot; : ObjectId(&quot;605525ed8f87f3c9bc136a69&quot;), &quot;price&quot; : &quot;double&quot; }
{ &quot;_id&quot; : ObjectId(&quot;605525fb8f87f3c9bc136a6a&quot;), &quot;price&quot; : &quot;double&quot; }
</code></pre>
<p>However, when I insert values from the Javascript driver, they are not all doubles, but instead the integer-looking number is stored with a bsontype of <code>int</code>:</p>
<pre><code>-- Node
  await products.insertOne({id: 1, price: 20});
  await products.insertOne({id: 2, price: 20.85});

--Mongo Shell
PRIMARY&gt; db.products.aggregate([{$project: { price: {$type: &quot;$price&quot;}}}])
{ &quot;_id&quot; : ObjectId(&quot;6055261ee2efe2622736a36e&quot;), &quot;price&quot; : &quot;int&quot; }
